import { InputsModel, ProductModel } from '../../@types/models';
import { stroykaApi } from '../stroyka.api';

type 

const injectedRegistration = stroykaApi.injectEndpoints({
    endpoints: (builder) => ({
        registrate: builder.query<any, InputsModel>({
            query: () => ({
                url: `auth/sign_up/`,
            }),
        }),
    }),
    overrideExisting: false,
})

export const { useLazyRegistrateQuery } = injectedRegistration;
